pd.DataFrame().iloc()

def extractNanRows(df, columnName):
    """
    Extracts rows in which the specified column contains NaN values.

    Args:
        df (pd.DataFrame): The input DataFrame.
        columnName (str): The name of the column to search for NaN values.

    Returns:
        tuple: Two DataFrames, the first containing rows with NaN values in the specified column, 
               and the second containing the rest.
    """
    nan_rows = []
    non_nan_rows = []
    
    for i, row in df.iterrows():
        element = row
        if pd.isna(row[columnName]):
            nan_rows.append(element)
        else:
            non_nan_rows.append(element)
            
    nan_rows_df = pd.DataFrame(nan_rows).reset_index(drop=True)
    non_nan_rows_df = pd.DataFrame(non_nan_rows).reset_index(drop=True)
    
    return nan_rows_df, non_nan_rows_df

def removeAdjacentValues(df, columnName, val, epsilon=2):
    """
    Removes values in the given column that are adjacent to a specific value within a given epsilon range.

    Args:
        df (pd.DataFrame): The input DataFrame.
        columnName (str): The name of the column to search for adjacent values.
        val (float): The value to check for adjacency.
        epsilon (float, optional): The range within which a value is considered adjacent. Defaults to 2.

    Returns:
        tuple: Two DataFrames, the first containing adjacent values and the second containing the rest.
    """
    #newDF = pd.DataFrame(); adjacentDF = pd.DataFrame()
    adjacent = []; rest = []
    for i, row in enumerate(df[columnName]):
        if type(row) != float or pd.isna(row):
            continue
        delta = row-val
        element = df.iloc[i]
        if abs(delta) <= epsilon:
            adjacent.append(element)
        else:
            rest.append(element)
    adjacent = pd.DataFrame(adjacent)
    rest = pd.DataFrame(rest)
    return adjacent, rest

def removeMinMax(df, columnName):
    """
    Removes the minimum and maximum values in the given column of the DataFrame.

    Args:
        df (pd.DataFrame): The input DataFrame.
        columnName (str): The name of the column to remove the minimum and maximum values from.

    Returns:
        tuple: Three DataFrames, the first containing the minimum values, the second containing the remaining DataFrame
               without the minimum and maximum values, and the third containing the maximum values.
    """
    listOfNumbers = []
    for el in list(df[columnName]):
        if type(el) == float and not pd.isna(el):
            listOfNumbers.append(el)

    minn = min(listOfNumbers)
    minn, df2 = removeAdjacentValues(df, columnName, minn)

    maxx = max(listOfNumbers)
    maxx, df2 = removeAdjacentValues(df2, columnName, maxx)

    return minn, df2, maxx

def are_adjacent_integers(df):
    """
    Checks if the rows/indeces in the DataFrame are adjacent.

    Args:
        df (pd.DataFrame): The input DataFrame.

    Returns:
        tuple: A boolean value indicating if the rows are adjacent, and an integer representing the index where the interruption happened. Returns True, -1 if all indices are adjacent or DataFrame is empty.
    """
    if not df.empty:
        prevIndex = df.index[0]
        for index in df.index[1:]:
            if index - prevIndex != 1:
                return False, index
            prevIndex = index

    return True, -1

def chop_up_to_be_adjacent(df):
    """
    Splits the DataFrame into continuous segments.
    
    This is useful for detecting and handling gaps in the DataFrame, after intentionally removing sections of rows (e.g., via removeMinMax), to ensure that the remaining segments maintain adjacency.

    Args:
        df (pandas.DataFrame): The DataFrame to be chopped, potentially with missing sections.

    Returns:
        list: A list of DataFrames, each containing a continuous segments, preserving continuity.

    Example:
        df = pd.DataFrame({'A': [1, 2, 4, 5, 7]}, index=[0, 1, 3, 4, 6])
        segments = chop_up_to_be_adjacent(df)  
        # This returns three DataFrames with adjacent index values
        # [[1,2], [4,5], [7]]
    """
    retVal = []
    df2 = df
    boolVal, problemIndex = are_adjacent_integers(df2)
    while not boolVal:
        if df2.empty:
            break
        first, second = df2.loc[:problemIndex-1], df2.loc[problemIndex:]
        retVal.append(first)
        df2 = second
        boolVal, problemIndex = are_adjacent_integers(df2)
    if not df2.empty:
        retVal.append(df2)
    return retVal


def isRisingFalling(array):
    """
    Determines if the values in the array are rising or falling.

    Args:
        array (list): The input array of float values.

    Returns:
        float: A coefficient representing the rising or falling trend. Positive for rising, negative for falling, and
               zero for flat.
    """
    n = len(array)
    first, second = array[:n//2], array[n//2:]
    avg1, avg2 = sum(first)/(n//2), sum(second)/(n-n//2)

    if avg2==avg1:return 0
    from numpy import cbrt 
    return cbrt((avg2-avg1)**5/(avg2-avg1)**4)


def forDataFrame(df, columnName = "AVG_T"):
    """
    Processes the DataFrame to categorize data into rising, falling, or flat trends.

    Args:
        df (pd.DataFrame): The input DataFrame.
        columnName (str, optional): The name of the column to analyze. Defaults to "AVG_T".

    Returns:
        tuple: A dictionary containing DataFrames for "flat," "rise," and "drop" trends, and an empty dictionary for each trend.
    """
    not_numbers, df2 = extractNanRows(df, columnName)
    minn, df2, maxx = removeMinMax(df2, columnName)
    retVal = {"flat": pd.concat([minn, maxx]), "rise":pd.DataFrame(), "drop":pd.DataFrame(), "nan":not_numbers}
    #retVal = {"flat":[minn, maxx], "rise":[], "drop":[]}
    #df2Indeces = df["Index"]
    if not df2.empty:
        severalDF = chop_up_to_be_adjacent(df2)
        for someDF in severalDF:
            coefficient = isRisingFalling(someDF[columnName])
            if coefficient > 0:
                retVal["rise"] = pd.concat([retVal["rise"], someDF])#.append(someDF)
            elif coefficient < 0:
                retVal["drop"] = pd.concat([retVal["drop"], someDF])#.append(someDF)
            elif coefficient == 0:
                retVal["flat"] = pd.concat([retVal["flat"], someDF])#.append(someDF)
            else:
                raise Exception("buraz trenutak")
    
    print("into loop")
    keys = [key for key in retVal]
    for key in keys:
        print('iter')
        if retVal[key].empty:
            retVal.pop(key)
        else:
            print("no need to pop")
        print("next iteration")
    print("all good")

    data = retVal
    constants = {"flat":{}, "rise":{}, "drop":{}, "nan":{}}
    plotFiles = {"flat":True, "rise":True, "drop":True, "nan":True}

    return retVal, constants, plotFiles
    

